import {
  SmileTwoTone,
  HeartTwoTone,
  CheckCircleTwoTone,
} from "@ant-design/icons";

import "./About.css";
function about() {
  return (
    <Fragment>
      <div className="Post">
        <h1>About this Project!</h1>
        <article className="para">huhg</article>
        <HeartTwoTone twoToneColor="#eb2f96" />
      </div>
    </Fragment>
  );
}
export default about;
